import React, {Component} from 'react';
import './post.css'

class Posts extends Component {
  constructor() {
    this.state = {
      posts: []
    }
  }

  render() {
    return (
      <div>
        <h1>Posts</h1>
      </div>
    )
  }
}

export default Posts;
